def from_hex_string(input_str):
    n = len(input_str) // 2
    output = bytearray(n)
    l = 0
    for k in range(n):
        c = input_str[l]
        b = (ord(c) - ord("a") + 10) if c >= "a" else (ord(c) - ord("0"))
        b <<= 4

        l += 1
        c = input_str[l]
        b |= (ord(c) - ord("a") + 10) if c >= "a" else (ord(c) - ord("0"))

        output[k] = b
        l += 1

    return output


